    false,nt"url": null,nt"notes": "This Comprehensive Conservation Plan (CCP)
    was written to guide management on Hobe Sound NWR for the next 15 years. This plan
    outlines the Refuge vision and purpose and describes how Hobe Sound NWR will contribute
    to the overall mission of the Refuge System. The plan provides an introduction to
    the Refuge, an overview of the CCP process, information on the Refuge environment
    and management direction, and strategies for plan implementation. Key planning issues
    include: wildlife habitat management, public use, partnerships, historical resources,
    resource protection, and administration.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
